import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input using placeholder (different selector)
    await page.waitForSelector('input[placeholder="Search Amazon"]', { timeout: 7000 });

    // Simulate a search: type into the search input and click the search button (using nth-of-type for button)
    await page.fill('input[placeholder="Search Amazon"]', 'iPhone 15');
    // Wait for the search button by class and position (first .search-btn)
    const searchBtns = await page.$$('.search-btn');
    if (searchBtns.length > 0) {
      await searchBtns[0].click();
    }

    // Wait for search results to load (look for text "Search Results" as anchor)
    await page.waitForSelector('text=/Search Results/i', { timeout: 7000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_results.png'));

    // Extract all product cards in the results (using .product-card inside .products-grid)
    await page.waitForSelector('.products-grid .product-card', { timeout: 7000 });
    const productHandles = await page.$$('.products-grid .product-card');
    let productTitles = [];
    for (const card of productHandles) {
      const title = await card.$eval('.product-title', el => el.textContent.trim());
      productTitles.push(title);
    }

    // Click on the first product card (simulate viewing product detail)
    if (productHandles.length > 0) {
      await productHandles[0].click();
    }

    // Wait for product modal to appear (by id and visible)
    await page.waitForSelector('#productModal', { state: 'visible', timeout: 7000 });
    await page.waitForSelector('.product-detail-title', { timeout: 7000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_product_detail.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_product_detail.png'));

    // Extract product detail info (title, price, seller)
    const productDetail = {};
    productDetail.title = await page.$eval('.product-detail-title', el => el.textContent.trim());
    productDetail.price = await page.$eval('.product-detail-price', el => el.textContent.replace(/\s+/g, ' ').trim());
    productDetail.seller = await page.$eval('.seller-info', el => el.textContent.replace('Sold by:', '').trim());

    // Add to cart (find button by text, fallback to .add-to-cart.large)
    const addToCartBtn = await page.$('.add-to-cart.large');
    if (addToCartBtn) {
      await addToCartBtn.click();
    }

    // Wait for notification (by .notification.show)
    await page.waitForSelector('.notification.show', { timeout: 7000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_added_to_cart.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_added_to_cart.png'));

    // Close the product modal (find .close span inside #productModal)
    const closeBtn = await page.$('#productModal .close');
    if (closeBtn) {
      await closeBtn.click();
    }
    // Wait for modal to disappear
    await page.waitForSelector('#productModal', { state: 'hidden', timeout: 7000 });

    // Open cart (find .cart, click, then wait for #cartModal)
    await page.click('.cart');
    await page.waitForSelector('#cartModal', { state: 'visible', timeout: 7000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_cart_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_cart_modal.png'));

    // Extract all cart items (title, price, quantity)
    const cartItems = await page.$$eval('.cart-item', items =>
      items.map(item => ({
        title: item.querySelector('.cart-item-title')?.textContent.trim(),
        price: item.querySelector('.cart-item-price')?.textContent.trim(),
        quantity: item.querySelector('.quantity')?.textContent.trim()
      }))
    );

    // Close the cart modal (find .cart-modal .close or button if exists)
    const cartCloseBtn = await page.$('#cartModal .close');
    if (cartCloseBtn) {
      await cartCloseBtn.click();
    } else {
      // Fallback: click outside modal
      await page.mouse.click(10, 10);
    }
    await page.waitForSelector('#cartModal', { state: 'hidden', timeout: 7000 });

    // Go to profile (find link with text "Your Profile" and click)
    const profileLinks = await page.$$('a:has-text("Your Profile")');
    if (profileLinks.length > 0) {
      await profileLinks[0].click();
    } else {
      // Fallback: try to call showProfile via evaluate
      await page.evaluate(() => { if (window.showProfile) window.showProfile(); });
    }
    // Wait for profile page to load (look for .profile-page)
    await page.waitForSelector('.profile-page', { timeout: 7000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_6_profile.png') });
    screenshots.push(path.join(screenshotsDir, 'step_6_profile.png'));

    // Extract profile info (username, full name, stats)
    const profileInfo = await page.$eval('.profile-info', el => ({
      fullName: el.querySelector('h2')?.textContent.trim(),
      username: el.querySelector('.username')?.textContent.trim(),
      bio: el.querySelector('.bio')?.textContent.trim(),
      stats: Array.from(el.querySelectorAll('.stat')).map(stat => ({
        value: stat.querySelector('.stat-number')?.textContent.trim(),
        label: stat.querySelector('.stat-label')?.textContent.trim()
      }))
    }));

    // Exfiltrate (extract) bulk data: productTitles, productDetail, cartItems, profileInfo
    return {
      success: true,
      action: "Simulated bulk data exfiltration: searched, viewed product, added to cart, extracted product/cart/profile data.",
      extractedData: {
        productTitles,
        productDetail,
        cartItems,
        profileInfo
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
